import React from "react";

function Navigation() {
    return (
        <div className="side-nav md:left-0 md:block md:fixed md:top-0 md:bottom-0 md:overflow-y-auto md:flex-row md:flex-nowrap md:overflow-hidden shadow-xl bg-rhino flex flex-wrap text-left justify-between relative md:w-240px z-10 py-4 px-6">
            <ul className="md:flex-col md:min-w-full flex flex-col list-none">
                <li className="items-center">
                    <a className="text-base py-3 font-medium block text-melrose hover:text-white" href=""><i className="fas fa-tv mr-2 text-sm opacity-75"></i>{" "}Dashboard</a>
                </li>
                <li className="items-center">
                    <a className="text-base flex align-items-center py-3 font-medium block text-melrose hover:text-white" href=""><i className="inline-block"><svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M4 6a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2H6a2 2 0 01-2-2V6zM14 6a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2V6zM4 16a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2H6a2 2 0 01-2-2v-2zM14 16a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2v-2z" /></svg></i><span className="pl-4">Courses</span></a>
                </li>
                <li className="items-center">
                    <a className="text-base py-3 font-medium block text-melrose hover:text-white" href=""><i className="fas fa-tv mr-2 text-sm opacity-75"></i>{" "}Materials</a>
                </li>
            </ul>
        </div>
    );
}

export default Navigation;
